Spring is almost here; are your wind chimes tuned-up &amp; ready?🎐

Here's how:
• lightly tap the longest tube with a ball-pean hammer;
• tap it harder and harder until it's a flat, noiseless metal pancake;
• repeat for all the other tubes and don't ever buy wind chimes again. https://t.co/SB237kYw9G
